import './SlideArrow.scss';

const SlideArrow = (props: {onClick: any }) => {
  const {onClick } = props;
  return (
    <div
      className="arrow"
      style={{
        display: "block",
        background: "#f7e0b2",
        margin: "10px",
        borderRadius: "20px",
        padding: "3px 2px 0.5px 2px",
      }}
      onClick={onClick}
    />
  );
};

export default SlideArrow;
